import Button from "./Button";

export default function AddField() {
    return (
      <div class="addField">
        <div class="buttonArea">
          <Button title = "Hello World" />
          <Button title = "Hello World" />
          <Button title = "Hello World" />
        </div>
        <div class= "fieldArea">
        </div>
     </div>
    );
};
